import { createSlice } from '@reduxjs/toolkit';

const accountS = createSlice({
  name: 'account',
  initialState: {
    username: '',
    password: '',
  },
  reducers: {
    set: (state, act) => {
      state.username = act.payload.username;
      state.password = act.payload.password;
    }
  },
});
export const {} = accountS.actions;
export default accountS.reducer;
